import { Link } from 'react-router-dom'

export default class MainMenu extends React.Component{
  render() {
    return(
      <div>
        <Link to="/item1">Item 1</Link>
        <Link to="/item1">Item 1</Link>,
        <Link to="/item1">Item 1</Link>,
        <Link to="/item1">Item 1</Link>,
        <Link to="/item1">Item 1</Link>,
        <Link to="/item1">Item 1</Link>,
      </div>
    )
  }
}
